import { NavLink } from 'react-router-dom';

const Accueil = () => {
  return (
    <div>
      <h1>Accueil</h1>
      {/* Primjer kori≈°tenja NavLink komponente za navigaciju */}
      <NavLink to="/druga-stranica" activeClassName="active-link">Idi na drugu stranicu</NavLink>
    </div>
  );
};

export default Accueil;
